import {
  PROFILE_SUCCESS
} from '../actions/profile';

export default function reducer(statePart = [], action = {}) {
  switch (action.type) {
    case PROFILE_SUCCESS:
      return{
        ...statePart,
        data: action.payload
      }
    default:
      return statePart;
  }
}
